comment:
왜저래 직원들 인성 개파탄났나?
아니 저건 사람을 개무시하는거잖아;;;;
친하다는 이유로 막말해도된다는거야 뭐야;;

이상한 사람들이네요~ 자기들도 못할 말을 왜 다른 사람한테 시키는지;
친하다고해도 어쨋든 사장은 사장이고 직원은 직원 아닙니까?ㅋㅋㅋㅋㅋㅋ
저래놓고 거절하면 뒤에서 씹거나 사장이 화내면 모른척할거면서 저런 사람들 제일 극혐ㅋㅋㅋ

그럼 잘못을 했으면 칭찬을 받아야됨?
;자기들이 잘못했으면서 왜저래
꾸중듣기 싫으면 더 열심히 하던가;
열심히 해도 계속 실수하면
혼날 때 그냥 가만히 있던가
아님 열심히 하는 모습을 보이던가 그래야지;

회사 사람들이 얼마나 눈칫밥을 먹였길래 저정도냐..;
진짜 지들이 말하지도 못할거
뒷담화하고 남한테 떠넘기는 사람들 최악이다;;

와 어디가 이쁘다고 푸딩까지..
야 저정도면 회사 직원들 미이 보이면 머리 조아리고
감사합니다 해야돼;

ㄹㅇ 오늘 눈은 안오지 날씨는 드럽게 맑지
재활용 쓰레기 버리는데 반바지 입고나가서 다리 터질뻔;
게다가 귀마개/장갑도 안함 
그냥 노출된 부위는 얼어 터지는줄 알음;

진짜 중립이 고생한다
세명중 두명이 싸우면
남은한명 진짜 곤란함;;

저거 4번째 베댓 나만 좀 그럼?
지가 베댓 친구도 아니고 인생몰입한지 안한지 어떻게 알아
꼭 저런새끼들이 인생몰입한 사람한테 진지충새끼 ㅇㅈㄹ 한다;;;

보겸이 누군데 이 난리..
보이루 보황 그러는데 뭔말인지도 모르겠고,,
웹툰이나 봅시다 웹툰에 상관없는 얘기들 꺼내시지마시고..;;
